import React, { Component } from "react";
//import logo, { ReactComponent } from "./logo.svg";
import "./App.css";
import Users from "./user/Users";

class App extends Component {
  render() {
    const names = "123";
    let naming = "World....";
    return (
      <div>
        Hello {names}.
        <Users />>
      </div>
    );
  }
}

export default App;
